import React from 'react';

function About() {

    return(
        <section className="container">
            <h2 class="top-title">Hicham Raffiai Idrissi</h2>
            <hr></hr>
            <div>
                <img class="mb-5" id="avatar" src="" alt="Hicham Raffiai Idrissi" />

                <p>
                I'm a full stack web developer, and my current skillset are (HTML, CSS (Bootstrap, HandleBars), JavaScript, jQuery, React.js, IndexedDB,
            Node.js, Express.js, SQL, Sequelize, MongoDB, Mongoose, NoSQL, APIs, Templating.)
                </p>
                <p>
               I'm also a  Quality Assurance Technician
                </p>

            </div>
        </section>
    )
}

export default About;
